import styles from './search.module.css';

export default function Search(props) {

  return (
    <div className={styles.container}>
      <div className={styles.search}>
        <input className={styles.currency_name_input} type="text" name="currency_name" placeholder='Enter the currency name' />
      </div>

      <div className={styles.filter}>
        <label htmlFor="radio_increasing">Increasing</label>
        <input type="radio" name="filter" value="increasing" />

        <label htmlFor="radio_decreasing">Decreasing</label>
        <input type="radio" name="filter" value="decreasing" />
      </div>
    </div>
  );
}
